import React from 'react';
import CharacterCard from './CharacterCard';

const CharacterList = ({ characters, addToFavorites }) => {
  return (
    <div>
      {characters.map(character => (
        <CharacterCard key={character.id} character={character} addToFavorites={addToFavorites} />
      ))}
    </div>
  );
};

export default CharacterList;
